import logo from './logo.svg';
import './App.css';
import Header from './Component/Header';
import Menu from './Component/Menu';
import Footer from './Component/Footer';
import Body from './Component/Body';

function App() {
  return (
    <div className='wrapper'>
      <Header />
      <Menu />
      <Body />
      <Footer />
    </div>
  );
}

export default App;
